import React from 'react';
import Word from "../../wordList/Word/Word";

function ModalWindow(props) {
    function createModalWindow(){
        return renderWord()
    }
    function renderWord(){
        return props.words.map(item => {
            console.log(item);
            return(
                <Word
                    key = {item.id}
                    word = {item.word}
                    translation = {item.translation}
                />
            )
        })
    }
    return (
        <div>
            {createModalWindow()}
        </div>
    );
}

export default ModalWindow;
